import React from 'react'
// import './home.css'
import {
    MDBBtn,
    MDBNavbarLink
  } from 'mdb-react-ui-kit';
import Header from '../../components/header/header';
const Home = () => {
    return (
        <div>
              <Header></Header>
            {/* <h1 style={{padding:500}}>This is the homepage</h1> */}
            <div style={{padding: 200}}>
                <h1 style={{marginBottom: 20}}>Featured Services</h1>
                <MDBNavbarLink >
              <MDBBtn
                rounded className='mx-2' color='black'
                href='services'
                style={{height: 30}}
              >
                All Services
              </MDBBtn>
              </MDBNavbarLink>
            </div>
        </div>
    )
}

export default Home;
